import React from "react"

interface Props {
	title: string
	calories: number
	img: string
}

const Recipe: React.FC<Props> = ({title, calories, img}) => {
	return (
		<>
			<h1>{title}</h1>
			<p>Calories: {Math.floor(calories)}</p>
			<img src={img} alt='' />
		</>
	)
}

export default Recipe
